import './App.css';
import MovieCard from './Components/MovieCard/MovieCard';

function App() {
  return (
    <div className="App">
      <span className="title">Recommended Movies</span>
      <section className="movie-container">
      <MovieCard name="Hamlet" />
      <MovieCard name="As You Like It"/>
      <MovieCard name="Othello"/>
      </section>
    </div>
  );
}

export default App;
